import React, { useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const Home = () => {
     let navigate = useNavigate();
useEffect(() => {
    axios.get('http://localhost:4000/home')
    .then(res => {
        if(res.ok){
            console.log("welcome")
        }else{
            navigate('/login');
        }
    })
    .catch(err => console.log(err))

})

    return (
        <div>Home</div>
    );
};

export default Home;
